import React, { useState, useEffect } from 'react';
import LayoutHeader from './components/LayoutHeader';
import PatientList from './components/PatientList';
import PatientDetailView from './components/PatientDetailView';
import PatientForm from './components/PatientForm';
import CalendarView from './components/CalendarView';
import AssistantView from './components/AssistantView';
import BudgetView from './components/BudgetView';
import DashboardCard from './components/DashboardCard';
import BarChart from './components/BarChart';
import PieChart from './components/PieChart';
import WeeklyAppointments from './components/WeeklyAppointments';
import InventoryManager from './components/InventoryManager';
import ReportsView from './components/ReportsView';
import AuditLog from './components/AuditLog';
import initialData from './mock/data';
import { initializeData } from './utils/storage';

const App = () => {
  const [currentView, setCurrentView] = useState('dashboard');
  const [selectedPatient, setSelectedPatient] = useState(null);
  const [showPatientForm, setShowPatientForm] = useState(false);
  const [editMode, setEditMode] = useState(false);

  const [pacientes, setPacientes] = useState([]);
  const [citas, setCitas] = useState([]);
  const [presupuestos, setPresupuestos] = useState([]);
  const [recetas, setRecetas] = useState([]);
  const [userRole, setUserRole] = useState('doctor');

  useEffect(() => {
    // 🔁 Forzar limpieza de almacenamiento temporal
    localStorage.clear();

    const loadedData = initializeData(initialData);
    setPacientes(loadedData.pacientes || []);
    setCitas(loadedData.citas || []);
    setPresupuestos(loadedData.presupuestos || []);
    setRecetas(loadedData.recetas || []);
    if (loadedData.pacientes.length > 0) {
      setSelectedPatient(loadedData.pacientes[0]);
    }
  }, []);

  return (
    <div className="min-h-screen bg-gray-50">
      <LayoutHeader />
      <div className="max-w-7xl mx-auto px-4 py-6 grid grid-cols-12 gap-6">
        <div className="col-span-3 space-y-4">
          <div className="bg-white rounded-lg shadow p-4">
            <h2 className="font-semibold mb-4">Navegación</h2>
            <nav className="space-y-2">
              <button className="w-full text-left px-4 py-2 rounded-lg hover:bg-gray-100" onClick={() => setCurrentView('dashboard')}>Dashboard</button>
              <button className="w-full text-left px-4 py-2 rounded-lg hover:bg-gray-100" onClick={() => setCurrentView('pacientes')}>Pacientes</button>
              <button className="w-full text-left px-4 py-2 rounded-lg hover:bg-gray-100" onClick={() => setCurrentView('calendario')}>Calendario</button>
              <button className="w-full text-left px-4 py-2 rounded-lg hover:bg-gray-100" onClick={() => setCurrentView('presupuestos')}>Presupuestos</button>
              <button className="w-full text-left px-4 py-2 rounded-lg hover:bg-gray-100" onClick={() => setCurrentView('inventario')}>Inventario</button>
              <button className="w-full text-left px-4 py-2 rounded-lg hover:bg-gray-100" onClick={() => setCurrentView('reportes')}>Reportes</button>
              <button className="w-full text-left px-4 py-2 rounded-lg hover:bg-gray-100" onClick={() => setCurrentView('configuracion')}>Configuración</button>
              {userRole === 'asistente' && (
                <button className="w-full text-left px-4 py-2 rounded-lg hover:bg-gray-100" onClick={() => setCurrentView('asistente')}>Vista Asistente</button>
              )}
            </nav>
          </div>
        </div>

        <div className="col-span-9 space-y-6">
          {currentView === 'pacientes' && (
            <>
              <div className="flex justify-between items-center mb-4">
                <h2 className="text-xl font-semibold">Pacientes</h2>
                <button
                  onClick={() => {
                    setShowPatientForm(true);
                    setEditMode(false);
                  }}
                  className="px-4 py-2 bg-blue-600 text-white rounded hover:bg-blue-700"
                >
                  Agregar Paciente
                </button>
              </div>

              {showPatientForm ? (
                <PatientForm
                  onSave={(newPatient) => {
                    setPacientes(prev => [...prev, newPatient]);
                    setShowPatientForm(false);
                  }}
                  onCancel={() => setShowPatientForm(false)}
                />
              ) : (
                <>
                  <PatientList patients={pacientes} onSelectPatient={setSelectedPatient} />
                  {selectedPatient && (
                    <PatientDetailView patient={selectedPatient} />
                  )}
                </>
              )}
            </>
          )}

          {currentView === 'dashboard' && (
            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
              <DashboardCard title="Pacientes" value={pacientes.length} color="blue" trend="+3 hoy" />
              <DashboardCard title="Citas" value={citas.length} color="green" trend="+2 esta semana" />
              <DashboardCard title="Presupuestos" value={presupuestos.length} color="purple" trend="+1 este mes" />
              <DashboardCard title="Recetas" value={recetas.length} color="yellow" trend="+5" />
            </div>
          )}

          {currentView === 'calendario' && <CalendarView citas={citas} pacientes={pacientes} />}
          {currentView === 'presupuestos' && <BudgetView presupuestos={presupuestos} pacientes={pacientes} />}
          {currentView === 'inventario' && <InventoryManager />}
          {currentView === 'reportes' && <ReportsView />}
          {currentView === 'configuracion' && <AuditLog />}
          {currentView === 'asistente' && <AssistantView />}
        </div>
      </div>
    </div>
  );
};

export default App;
